const v = [
    {
        id: 1,
        name: "1",
        duration: 14,
    },
    {
        id: 2,
        name: "2",
        duration: 14,
    },
    {
        id: 3,
        name: "3",
        duration: 14,
    }
]

export function VideoList(){
    return(
        <>
            <h1>VideoList</h1>
            {
                v.map((v) => {
                    return(
                        <div>
                            <p>{v.name}</p>
                            <p>{v.duration}</p>
                            <button>ЛАЙК</button>
                        </div>
                    )
                })
            }
        </>
    )
    
}
